import React from 'react';

const News = (props) => {

		const dataLocal = props.dataLocal

		const display = (
		    <div>
				<div className='infoCategory'>
				{dataLocal.category}
				</div>
				<div className='infoTitle'>
				{dataLocal.title}
				</div>
				<p>
				{dataLocal.content}
				</p>
		    </div>
		)

		return (
				<div>
				{display}
				</div>
		)
}
export default News;
